import { Route, Router } from "react-router";
import "./App.css";
import Parent from "./components/Parent";
import Child from "./components/Child";

function App() {
  return (
    <div className="App">
      <Parent />
      <Router>
        <Route path="/" component={Parent}>
          <Route path="/child" component={Child} />
        </Route>
      </Router>
    </div>
  );
}

export default App;
